--DROP TABLE IF EXISTS dhtreadings CASCADE;

--Cria tabela dhtreadings
CREATE TABLE IF NOT EXISTS dhtreadings
(
    id serial,
    temperature numeric,
    humidity numeric,
    currentdate timestamp,
    device varchar(255),
    primary key(id)
);

ON CONFLICT (id) DO NOTHING;
